import React from 'react';
import { useGlobalcontext } from '../context/context';

const Movie = () => {
    const {movie}=useGlobalcontext();
  return (
    <>
    {movie.map((curr)=>{
        return(
        <div>
         <h2>{curr.Title}</h2>
        </div>
        )
    })}

    </>
    
  );
}

export default Movie;
